description:
Bulgarije / Verenigd Koninkrijk / Verenigde Staten
Actie
105 minuten

goed

met Wesley Snipes, Eliza Bennett en Lena Headey

Enkele jaren geleden mislukte de opdracht van CIA-huurmoordenaar James Dial om de leider van een terreurcel, Ali Mahmoud Jahar, 
om te brengen. Recent werd die laatste opgepakt en vastgehouden in Londen. Dial, die ermee gestopt is en nu in afzondering leeft, 
krijgt de kans van zijn voormalige werkgever Jeremy Collins om Jahar alsnog te elimineren. Samen met assistent Terry Winchell 
vertrekt Dial naar het Verenigd Koninkrijk.
